import React, { useState, useEffect } from 'react';
import { Container, Row, Col, Card, Button, Alert, Spinner } from 'react-bootstrap';
import { useAuth } from '../contexts/AuthContext';
import { Link, useNavigate } from 'react-router-dom';
import axios from 'axios';

function Profile() {
    const { currentUser } = useAuth();
    const navigate = useNavigate();
    const [userItems, setUserItems] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState('');

    useEffect(() => {
        if (!currentUser) {
            navigate('/login');
            return;
        }
        
        if (currentUser.id) {
            fetchUserItems();
        }
    }, [currentUser, navigate]);

    const fetchUserItems = async () => {
        try {
            setLoading(true);
            setError('');
            console.log('Fetching items for user:', currentUser.id);
            
            const response = await axios.get(`http://localhost:5000/api/items?seller=${currentUser.id}`, {
                headers: {
                    'Authorization': `Bearer ${localStorage.getItem('token')}`
                }
            });
            
            console.log('User items response:', response.data);
            setUserItems(response.data);
        } catch (err) {
            console.error('Error fetching user items:', err);
            setError('Failed to fetch user data. Please try again later.');
        } finally {
            setLoading(false);
        }
    };

    if (!currentUser) {
        return (
            <Container className="mt-5">
                <Alert variant="warning">
                    Please log in to view your profile.
                </Alert>
            </Container>
        );
    }

    if (loading) {
        return (
            <Container className="mt-5 text-center">
                <Spinner animation="border" role="status">
                    <span className="visually-hidden">Loading...</span>
                </Spinner>
            </Container>
        );
    }

    if (error) {
        return (
            <Container className="mt-5">
                <Alert variant="danger">
                    <Alert.Heading>Error</Alert.Heading>
                    <p>{error}</p>
                    <hr />
                    <div className="d-flex justify-content-end">
                        <Button variant="primary" onClick={fetchUserItems}>Retry</Button>
                    </div>
                </Alert>
            </Container>
        );
    }

    return (
        <Container className="mt-5">
            <Row>
                <Col md={4}>
                    <Card className="mb-4">
                        <Card.Body>
                            <h3>Profile</h3>
                            <p><strong>Name:</strong> {currentUser.name}</p>
                            <p><strong>Email:</strong> {currentUser.email}</p>
                            <p><strong>Phone:</strong> {currentUser.phone}</p>
                            <Link to="/settings">
                                <Button variant="primary">Edit Profile</Button>
                            </Link>
                        </Card.Body>
                    </Card>
                </Col>
                <Col md={8}>
                    <Card>
                        <Card.Body>
                            <div className="d-flex justify-content-between align-items-center mb-4">
                                <h3>My Listings</h3>
                                <Link to="/sell">
                                    <Button variant="success">Sell New Item</Button>
                                </Link>
                            </div>
                            {userItems.length === 0 ? (
                                <p>You haven't listed any items yet.</p>
                            ) : (
                                <Row>
                                    {userItems.map(item => (
                                        <Col md={6} key={item._id} className="mb-4">
                                            <Card>
                                                {item.images && item.images.length > 0 && (
                                                    <Card.Img
                                                        variant="top"
                                                        src={item.images[0]}
                                                        style={{ height: '200px', objectFit: 'cover' }}
                                                    />
                                                )}
                                                <Card.Body>
                                                    <Card.Title>{item.title}</Card.Title>
                                                    <Card.Text>
                                                        <strong>Price:</strong> ${item.price}<br />
                                                        <strong>Status:</strong> {item.status}
                                                    </Card.Text>
                                                    <Link to={`/items/${item._id}`}>
                                                        <Button variant="primary">View Details</Button>
                                                    </Link>
                                                </Card.Body>
                                            </Card>
                                        </Col>
                                    ))}
                                </Row>
                            )}
                        </Card.Body>
                    </Card>
                </Col>
            </Row>
        </Container>
    );
}

export default Profile;
